        return (
            <div className="about-container">
                <div className="card card-size card-center card-shadow">
                    <div className="grid-about-container">
                        <div className="grid-about-item">

                        </div>
                        <div className="grid-about-item">

                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default AboutMe;
